def search(x,d,lst):
    while d>0:
        lst[d]+=1
        if x%6==4 and x>4:
            search(x//3,d-1,lst)
        x*=2
        d-=1
    lst[d]+=1
def A005186_list(n_max):
    lst=[0]*(n_max+1)
    search(1,n_max,lst)
    return lst[::-1]
